import Header from './common/header'
import Footer from './common/footer'

function App () {
  return (
    <Fragment>
      {/* 全局样式组件写在根节点内的最上面 */}
      <GlobalStyle />

      <Header />
      <div>hello sw</div>
      <Footer />
    </Fragment>
  )
}

export default App
